import React, { useEffect, useState } from 'react';
import { Transition } from '@headlessui/react';
import EfectoEscritura from './EfectoEscritura';
import Inicio from './Inicio';
import Tecnologias from './Tecnologias';
import Experiencia from './Experiencia';
import Proyectos from './Proyectos';
import Contacto from './Contacto';

function Slider() {
  const [seccionAnimacion, setseccionAnimacion] = useState('Inicio');
  const [mostrarPantallaInicial, setMostrarPantallaInicial] = useState(true);
  const [menuAbierto, setMenuAbierto] = useState(false); // Estado para el menú hamburguesa

  useEffect(() => {
    const tiempo = setTimeout(() => {
      setMostrarPantallaInicial(false);
    }, 2250);

    return () => clearInterval(tiempo);
  }, []);

  const navegacion = (seccion) => {
    setseccionAnimacion(seccion);
    const elemento = document.getElementById(seccion);
    if (elemento) {
      elemento.scrollIntoView({ behavior: 'smooth' });
    }
    // Cerrar el menú después de hacer clic en un elemento
    setMenuAbierto(false);
  };

  useEffect(() => {
    const titulos = {
      Inicio: 'Inicio',
      Tecnologias: 'Tecnología',
      ExperienciayFormacion: 'Experiencia y Formación',
      Proyectos: 'Proyectos',
      Contacto: 'Contacto',
    };
    document.title = titulos[seccionAnimacion];
  }, [seccionAnimacion]);

  return (
    <>
      <div className="relative">
        <Transition
          show={mostrarPantallaInicial}
          enter="transition-opacity duration-1000"
          enterFrom="opacity-0"
          enterTo="opacity-100"
          leave="transition-opacity duration-1000"
          leaveFrom="opacity-100"
          leaveTo="opacity-0"
        >
          <div className="fixed inset-0 bg-black flex items-center justify-center text-white text-4xl font-bold z-50">
            <EfectoEscritura />
          </div>
        </Transition>

        <Transition
          show={!mostrarPantallaInicial}
          enter="transition-opacity duration-1000"
          enterFrom="opacity-0"
          enterTo="opacity-100"
          leave="transition-opacity duration-1000"
          leaveFrom="opacity-100"
          leaveTo="opacity-0"
        >
          {/* Menú hamburguesa para móvil */}
          <nav className="fixed top-0 left-0 right-0 flex justify-between items-center py-4 px-6 md:hidden z-50">
            <div className="flex items-center">
              <button
                onClick={() => setMenuAbierto(!menuAbierto)}
                className="text-gray-400 focus:outline-none"
              >
                <svg
                  className="h-8 w-8"
                  xmlns="http://www.w3.org/2000/svg"
                  viewBox="0 0 20 20"
                  fill="currentColor"
                >
                  <path
                    fillRule="evenodd"
                    d="M3 5a1 1 0 0 1 1-1h12a1 1 0 0 1 0 2H4a1 1 0 0 1-1-1zM3 9a1 1 0 0 1 1-1h12a1 1 0 0 1 0 2H4a1 1 0 0 1-1-1zM4 13a1 1 0 1 1 0-2h12a1 1 0 0 1 0 2H4z"
                    clipRule="evenodd"
                  />
                </svg>
              </button>
            </div>
            <div className="flex items-center">
              <button
                onClick={() => navegacion('Inicio')}
                className={`py-3 px-4 md:py-5 md:pr-10 md:pl-10 focus:outline-none rounded-full transition duration-300 ease-in-out ${
                  seccionAnimacion === 'Inicio'
                    ? 'text-black font-bold'
                    : 'text-gray-400 font-bold'
                }`}
              >
                INICIO
              </button>
              <button
                onClick={() => navegacion('Tecnologias')}
                className={`py-3 px-4 md:py-5 md:px-6 md:pr-10 md:pl-10 focus:outline-none rounded-full ml-4 md:ml-4 transition duration-300 ease-in-out ${
                  seccionAnimacion === 'Tecnologias'
                    ? 'text-black font-bold'
                    : 'text-gray-400 font-bold'
                }`}
              >
                TECNOLOGÍAS
              </button>
              <button
                onClick={() => navegacion('ExperienciayFormacion')}
                className={`py-3 px-4 md:py-5 md:px-4 md:pr-10 md:pl-10 focus:outline-none rounded-full ml-4 md:ml-4 transition duration-300 ease-in-out ${
                  seccionAnimacion === 'ExperienciayFormacion'
                    ? 'text-black font-bold'
                    : 'text-gray-400 font-bold'
                }`}
              >
                EXPERIENCIA Y FORMACIÓN
              </button>
              <button
                onClick={() => navegacion('Proyectos')}
                className={`py-3 px-4 md:py-5 md:pl-10 md:px-10 md:pr-10 focus:outline-none rounded-full ml-4 md:ml-4 transition duration-300 ease-in-out ${
                  seccionAnimacion === 'Proyectos'
                    ? 'text-black font-bold'
                    : 'text-gray-400 font-bold'
                }`}
              >
                PROYECTOS
              </button>
            </div>
          </nav>
        </Transition>

        <Inicio seccionAnimacion={seccionAnimacion} navegacion={navegacion} />

        <Tecnologias seccionAnimacion={seccionAnimacion} />

        <Experiencia seccionAnimacion={seccionAnimacion} />

        <Proyectos seccionAnimacion={seccionAnimacion} />

        <Contacto seccionAnimacion={seccionAnimacion} />
      </div>
    </>
  );
}

export default Slider;
